    false,nt"url": null,nt"notes": "This brief report summarizes the methods
    and results of sediment sampling that took place on the Niobrara River below the
    Cornell Bridge, near Fort Niobrara National Wildlife Refuge, in 2014. Bedload and
    suspended sediment samples were collected for sediment size characterization and
    volume estimates. The samples were sieved by a private Engineering firm in Pierre,
    SD. Suspended sediment volumes were analyzed by a private lab in Rapid City, SD.",nt"owner_org":
